```
\documentclass{article}
\usepackage{tikz}
\usetikzlibrary{shapes.geometric, arrows.meta}

\begin{document}

\begin{tikzpicture}[
    node distance=1cm,
    start/.style={diamond, aspect=2, draw, fill=blue!20, text width=4em, text centered, minimum height=2.5em},
    process/.style={rectangle, draw, fill=blue!20, text width=10em, text centered, minimum height=3em},
    decision/.style={diamond, aspect=2, draw, fill=blue!20, text width=4em, text centered, minimum height=2.5em},
    arrow/.style={-Stealth}
    ]
    \node (start) [start] {Start};
    \node (process1) [process, below of=start] {Process 1};
    \node (decision1) [decision, below of=process1] {Decision 1};
    \node (process2) [process, below of=decision1] {Process 2};
    \node (decision2) [decision, below of=process2] {Decision 2};
    \node (process3) [process, below of=decision2] {Process 3};
    \node (end) [start, below of=process3] {End};

    \draw [arrow] (start) -- (process1);
    \draw [arrow] (process1) -- (decision1);
    \draw [arrow] (decision1) -- (process2);
    \draw [arrow] (process2) -- (decision2);
    \draw [arrow] (decision2) -- (process3);
    \draw [arrow] (process3) -- (end);
\end{tikzpicture}

\end{document}
